const avenidas = Number(env.get("AVENIDAS"));
const caracois = Number(env.get("CARACOIS"));
const luzes = {};

for (let i = 1; i <= avenidas; i++) {
    for (let j = 1; j <= caracois; j++) {

        const caracol = i * 100 + j;

        luzes[caracol] = [
            msg.payload[`DB3G1-${caracol}`],
            msg.payload[`DB3G2-${caracol}`],
            msg.payload[`DB3G3-${caracol}`],
            msg.payload[`DB3G4-${caracol}`],
            msg.payload[`DB3G5-${caracol}`],
            msg.payload[`DB3G6-${caracol}`],
            msg.payload[`DB3G7-${caracol}`],
            msg.payload[`DB3G8-${caracol}`],
            msg.payload[`DB3G9-${caracol}`],
            msg.payload[`DB3G10-${caracol}`]
        ]
    };
}

global.set("luzes", luzes);
return msg;

const avenidas = Number(env.get("AVENIDAS"));
const caracois = Number(env.get("CARACOIS"));
const luzVerde = {};

for (let i = 1; i <= avenidas; i++) {
    for (let j = 1; j <= caracois; j++) {

        const caracol = i * 100 + j;
        luzVerde[caracol] = msg.payload[`ConfirmaGaiolaDB3-${caracol}`];
    }
}

global.set("luzVerde", luzVerde);
return msg;

const luzVerde = global.get("luzVerde") || {};
const luzVerdeBackup = global.get("luzVerdeBackup") || {};
const caracois = Number(env.get("CARACOIS"));

const avenida = 1;
const variavel = [];

for (const index of [...Array(caracois).keys()]) {
    const caracol = avenida * 100 + index;

    if (luzVerde[caracol] == 0 || luzVerdeBackup[caracol] == 0) {
        continue;
    }

    msg.url = `${env.get("CARACOL_URL")}/Caixa/Estufar/${caracol}`;

    luzVerdeBackup[caracol] = 0;
    variavel.push(`ConfirmaGaiolaDB3-${luzVerde[caracol]}`);

    msg.payload = 1;
    break;
}

global.set("luzVerdeBackup", luzVerdeBackup);
msg.variable = variavel;

return msg;

