const luzVerde = global.get("luzVerde") || [];
const luzVerdeBackup = global.get("luzVerdeBackup") || luzVerde;
const caracois = Number(env.get("CARACOIS"));

const avenida = 4;
const inicio = (avenida - 1) * caracois;
const variavel = [];
const liberado = [...Array(caracois).keys()].map(i => inicio + i);

for (const index of liberado) {
    if(luzVerde[index][1] == 0 || luzVerdeBackup[luzVerde[index][0]] == 0) {
        continue;
    }

    msg.url = `${env.get("CARACOL_URL")}/Caixa/Estufar/${luzVerde[index][0]}`;

    luzVerdeBackup[luzVerde[index][0]] = 0;
    variavel.push(`ConfirmaGaiolaDB3-${luzVerde[index][0]}`);

    msg.payload = 1;
    break;
}

global.set("luzVerdeBackup", luzVerdeBackup);
msg.variable = variavel;

return msg;

const luzes = global.get("luzes");
const luzVerde = global.get("luzVerdeBackup") || {};
const caracol = Number(msg.req.params.caracol);

msg.payload = {
    caracol,
    luzesVM: luzes[caracol],
    luzesVD: luzVerde[caracol] || 0
};

return msg;

