    caracol: 0,
    luzAcesa: 0,
};

const caracolAceso = Number(
    Object.keys(luzverde).filter((key) => luzverde[key] === 1)[0] || 0
);

if (caracolAceso > 0) {
    msg.payload.caracol = caracolAceso;
    msg.payload.luzacessa = 1;
}

return msg;

const caracol = Number(msg.req.params.caracol);
const gaiola = Number(msg.req.params.gaiola);

